import React from 'react';
import "./Contact.css"



function Contact(){

    const users = [
        {
          name: 'Robert Reyes',
          avatar: 'https://randomuser.me/api/portraits/men/28.jpg',
          online: false
        },
        {
          name: 'Nellie Caldwell',
          avatar: 'https://randomuser.me/api/portraits/women/17.jpg',
          online: true
        },
        {
          name: 'Vernon Mason',
          avatar: 'https://randomuser.me/api/portraits/men/84.jpg',
          online: true
        },
        {
          name: 'Erica Hunt',
          avatar: 'https://randomuser.me/api/portraits/women/87.jpg',
          online: false
        },
        {
          name: 'Juanita Phillips',
          avatar: 'https://randomuser.me/api/portraits/women/55.jpg',
          online: true
        }
      ];

    return <div className="Contact">

          <ul>
          	{users.map ( index => <li className="name">{index.name}</li>)}
          </ul>
          <div className="status">
            {users.map ( index => <li><img className="avatar" src={index.avatar}/></li>)}
        	  {users.map ( index => index.online ? <ul><li className="status-online" >online</li><li><img className="avatar" src={index.avatar}/></li></ul> : <li className="status-offline">offline</li>)}
          </div>

    </div>
}

export default Contact;
